%pyspark
import ujson
import pyspark.sql.types as T
from parsepy.query_normalizer import no_bow_normalizer

normalize = no_bow_normalizer().normalize

def extract(row):
    if not ('"action": "query"' in row or '"action": "page"' in row):
        return

    if '"ctry": "de"' not in row:
        return

    try:
        row = ujson.loads(row)
    except:
        return

    if row['action'] == 'query':
        raw_query = row.get('payload', {}).get('q')
    else:
        raw_query = row.get('payload', {}).get('qr', {}).get('q')

    if raw_query:
        nobow_query = normalize(raw_query)
        bow_query = ' '.join(sorted(nobow_query.split()))
        yield T.Row(bow_query=bow_query, nobow_query=nobow_query, freq=1)

queries = data.flatMap(extract).toDF().cache()
queries.count()
